export function Square({onSquareClick, selected}) {

    return (<>
      <div className={selected? "square selected" : "square"} onClick={onSquareClick}>
        <div className='sql1'>
          <div className='sql2'>
            <div className='sql3'>
              <div className='sql4'>
                <div className='div-image'>
                  <img src='./src//images/face-neutral.png' />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>

    );
    //return <button className="square" onClick={onSquareClick}>{value}</button>;
  }
